export const postLogin = data => {
  return axios({
    url: `${ROOT}/api/login`,
    method: 'POST',
    data
  })
    .then(response => {
      return {
        data: response.data,
        error: ''
      };
    })
    .catch(error => {
      return {
        error: error.response.data.message || 'server error'
      };
    });
};

export const getLogout = () => {
  return axios({
    url: `${ROOT}/api/logout`,
    method: 'GET'
  }).catch(error => {
    console.log(error);
  });
};

export const getUsers = ({ limit, pageIndex }) => {
  return axios({
    url: `${ROOT}/api/users?limit=${limit}&pageIndex=${pageIndex}`,
    method: 'GET'
  })
    .then(response => {
      return response.data;
    })
    .catch(error => {
      console.log(error);
    });
};

export const addLikeUser = partnerId => {
  return axios({
    url: `${ROOT}/api/users/likes/${partnerId}`,
    method: 'PUT'
  })
    .then(response => {
      console.log(response);
    })
    .catch(error => {
      console.log(error);
    });
};

export const getLikeMe = () => {
  return axios({
    url: `${ROOT}/api/user/likes`,
    method: 'GET'
  })
    .then(response => {
      return response.data.likes_me;
    })
    .catch(error => {
      console.log(error);
    });
};

export const postChat = partnerId => {
  return axios({
    url: `${ROOT}/api/chats/${partnerId}`,
    method: 'POST'
  })
    .then(response => {
      return response.data;
    })
    .catch(error => {
      console.log(error);
    });
};

export const getChats = () => {
  return axios({
    url: `${ROOT}/api/chats`,
    method: 'GET'
  })
    .then(response => {
      return response.data;
    })
    .catch(error => {
      console.log(error);
    });
};

export const getChat = roomId => {
  return axios({
    url: `${ROOT}/api/chats/${roomId}`,
    method: 'GET'
  })
    .then(response => {
      return response.data.chat;
    })
    .catch(error => {
      console.log(error);
    });
};

export const postNewMessage = (roomId, data) => {
  return axios({
    url: `${ROOT}/api/chats/${roomId}`,
    method: 'PUT',
    data
  })
    .then(response => {
      console.log(response.data);
      return response.data;
    })
    .catch(error => {
      console.log(error);
    });
};

export const putUserInfo = (userData, formData = null) => {
  return axios
    .put(`${ROOT}/api/user`, {
      ...userData
    })
    .then(response => {
      if (formData) {
        return axios
          .put('/api/upload', formData)
          .then(result => {
            return result.data.user;
          })
          .catch(error => {
            return {
              error: error.response.data.message || 'server error'
            };
          });
      } else {
        return response.data.user;
      }
    })
    .catch(error => {
      return {
        error: error.response.data.message || 'server error'
      };
    });
};
